import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

class CallToActionPharse extends Component {

  constructor( props )
  {

    super(props);

  }

  render() {

    let { text, button } = this.props;

    return (
      <div data-pharse-call-to-action>

        <div data-container-pharse-call-to-action>

          <p data-description dangerouslySetInnerHTML={{ __html: text }} />

          <Link to={button.link}>
            <button data-colored="big">{button.title}</button>
          </Link>

        </div>

      </div>
    );
  }
}
export default CallToActionPharse;
